import React, { Component } from 'react'
import axios from 'axios';

class PostList extends Component {
     constructor(props) {
         super(props)
     
         this.state = {
              posts:[],
              error:""
         }
     }
     
     componentDidMount(){
         axios.get('https://cricapi.com/api/matches/rXH9Y3RJu3YVsF51R6FSTwLR24h2')
         .then(Response=>{
             //console.log(Response.data.matches)
             this.setState({
                posts:Response.data.matches
             })
         })
         .catch(error=>{
            //console.log(error)
             this.setState({
                 error: "bahot error"
             })
         })
     }

    render() {
        const {posts,error}=this.state
        return (
            <div>{
                console.log(posts)
                }
            </div>
        )
    }
}

export default PostList
